  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment (EA) documents
  the results of a study of the potential environmental impacts of actions proposed
  by the U.S. Fish and Wildlife Service to reduce the fire hazard and restore forest
  system health at Red Rock Lakes National Wildlife Refuge by use of mechanical and
  prescribed fire methods. This plan helps establishe overall rules and guidance for
  management and forest stand restoration related actions taken within the refuge.
  Therefore, the alternative courses of action considered in this EA were crafted
  to be consistent with the concepts established in them. This environmental assessment
  contains the Finding of No Significant Impact and Compatibility Determination.\",\n\t\"owner_org\":
